import React from 'react';
import { useNavigate, Link } from "react-router-dom";
import LogoutButton from './LogoutButton';
import Profile from './Profile';
import AdminRouteProtection from './AdminRouteProtection';
import './HomeAdmin.css'

const HomeAdmin = () => {
    AdminRouteProtection();
    const [isProfileclicked, setProfileclicked] = React.useState(false);
    let navigate = useNavigate();
    return (
        <div>
            <h1>Home Admin Page </h1>
            <p><button onClick={() => {
                    navigate("/");
                }}>Main Page</button></p>
            <LogoutButton />
            <p></p>
            <p><button onClick={() => {
                    navigate("/AdminNews");
                }}>News</button></p>
            <p><button onClick={() => {
                    navigate("/AdminNewsAdd");
                }}>Add News</button></p>
            <p><button onClick={() => {
                    navigate("/AdminSafeLocations");
                }}>Safe Locations</button></p>
            <p><button onClick={() => {
                    navigate("/AdminSafeLocationsAdd");
                }}>Add Safe Locations</button></p>
            <p><button onClick={() => {
                    navigate("/AdminFundraisers");
                }}>Fundraisers</button></p>
            <p><button onClick={() => {
                    navigate("/AdminFundraisersAdd");
                }}>Add Fundraisers</button></p>
            <p><button onClick={() => {
                    navigate("/AdminAlerts");
                }}>Alerts</button></p>
            <p><button onClick={() => {
                    navigate("/AdminAlertsAdd");
                }}>Add Alerts</button></p>
            <p><button onClick={() => {
                    navigate("/AdminRequests");
                }}>User Requests</button></p>
            <button onClick={() => {isProfileclicked ? setProfileclicked(false) : setProfileclicked(true)}}>View Account Details</button>
            { isProfileclicked ? <Profile /> : null }
        </div>
    )
}

export default HomeAdmin;
